Here's a Python program that prints out the first 100 prime numbers:

```python
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

primes = []
number = 2
while len(primes) < 100:
    if is_prime(number):
        primes.append(number)
    number += 1

print("The first 100 prime numbers are:", primes)
```

This program defines a function `is_prime()` to check whether a given number is prime or not. Then, it initializes an empty list called `primes` and a variable `number` with the value 2. It continues to increment `number` by 1 until the length of `primes` reaches 100. For each `number`, it checks if it's prime using the `is_prime()` function, and if so, adds it to the `primes` list. Finally, it prints out the first 100 prime numbers.
